import './normalize.css';
import './App.css';


function App() {
  return (
    <div className="App">
      <aside className="sideMenu">
        <div className="sideMenu-button">
          <span> + </span>
          New Chat
        </div>
      </aside>
      <section className="chatBox">
        <div classname="chat-input-box">

          <textarea 
          rows="1"
          classname="chat-input-textarea"
          placeholder="Type your message here">
          </textarea>

        </div>
      </section>
    </div>
  );
}

export default App;
